USE fest;
CREATE VIEW num_par_event AS
SELECT event_name, COUNT(registration_id)
FROM participates,`event`
WHERE `event`.event_number=participates.event_number
GROUP BY `event`.event_name;

CREATE VIEW total_attendees AS
SELECT COUNT(registration_id)
FROM attendees;

CREATE VIEW volunteer_info AS
SELECT first_name, last_name, email, phone_number
FROM `volunteer` INNER JOIN `student`;

CREATE VIEW stall_info AS
SELECT stall_id, stall_type, stall_location
FROM stalls;

CREATE VIEW totalCash AS
SELECT event_name, SUM(cash)
FROM `event` NATURAL JOIN sponsors
GROUP BY event_name;

SELECT * FROM num_par_event;
SELECT * FROM total_attendees;

create database fest;
use fest;
CREATE TABLE `participates` (
  `registration_id` int NOT NULL,
  `event_number` int NOT NULL,
  PRIMARY KEY (`registration_id`,`event_number`)
);

